messages.message:
There is currently **no explicit limit** for nested conditional expressions (the ternary `? :` operator), and the function is **recursive**: each `parseConditionalExpression` can call `parseAssignmentExpression`, which can call back into `parseConditionalExpression`, and so on. This can easily exhaust the stack for deeply nested ternary expressions.

**Solution:**  
- Refactor `parseConditionalExpression` to use an explicit stack and a loop, similar to `parseAssignmentExpression`.
- Add a limit, e.g., `MAX_NESTED_CONDITIONALS`, to prevent excessive nesting.

**Patch Plan:**
1. In `include/hermes/AST/ESTree.h`, add:
   ```cpp
   constexpr unsigned MAX_NESTED_CONDITIONALS = 30000;
   ```
2. In `parseConditionalExpression`, use a stack-based loop to handle nested conditionals, and error out if the limit is exceeded.

Let's prepare the patch.
Here is the patch to make `parseConditionalExpression` iterative and add a nesting limit:

```diff
--- a/include/hermes/AST/ESTree.h
+++ b/include/hermes/AST/ESTree.h
@@ -950,6 +950,9 @@
 constexpr unsigned MAX_NESTED_BINARY = 30000;
+
+/// An arbitrary limit to nested conditional (ternary) expressions.
+constexpr unsigned MAX_NESTED_CONDITIONALS = 30000;

 /// Check if an AST node is of the specified type and its `_operator`
 /// attribute is within the set of allowed operators.
--- a/lib/Parser/JSParserImpl.cpp
