But, in the tail recursion of expressions (e.g., member expressions, call expressions, etc.), the code still uses recursive calls (notably in `parseOptionalExpressionExceptNew_tail` and similar places), and the recursion depth is tracked by `recursionDepth_` and checked by `recursionDepthCheck()`. However, in the main assignment expression loop, there is no check for the *overall* parser recursion depth before entering the iterative loop, only for assignment nesting.

**Patch Plan:**
- Add a check for the overall parser recursion depth at the start of `parseAssignmentExpression` (and possibly in other deeply recursive entry points if needed).
- If the recursion depth exceeds a safe threshold, call `recursionDepthExceeded()` and abort parsing.
- This will prevent stack exhaustion by limiting the parser's call depth, regardless of the specific expression type.

