responded: The stack overflow vulnerability is due to unbounded recursion in `parseAssignmentExpression`, specifically when parsing nested assignment or conditional expressions in JavaScript (i.e., deeply nested uses of `a ? b : c ? d : ...`).

**Current logic:**
- `parseAssignmentExpression` is implemented in a non-recursive way for assignment chains (using a stack and `MAX_NESTED_ASSIGNMENTS`), but not for conditional expressions (`parseConditionalExpression`), which is called recursively.
- `parseConditionalExpression` calls itself via `parseAssignmentExpression` for both the `consequent` and `alternate` branches of a ternary operator without any explicit recursion depth guard.
- There is a `CHECK_RECURSION` macro used, but its effect is unclear from the snippet.

### Correct Fix/Approach

**Goal:** Add a recursion/breadth guard for conditional expression nesting, similar to `MAX_NESTED_ASSIGNMENTS` for assignment chains. The fix should:
- Track and limit the nesting depth of conditional expressions using a constant (e.g., `MAX_NESTED_CONDITIONALS`) and a counter.
- Return an error or `None` when the limit is exceeded.

**Required Patch Steps:**
1. Define `MAX_NESTED_CONDITIONALS` in `ESTree.h`.
2. Add a recursion depth parameter with default value to `parseConditionalExpression` and propagate it in recursive calls.
3. If the depth exceeds the constant, call `recursionDepthExceeded()` and return `None`.

